                "hashtag": "#JJ72",
                "bio": "JJ72 were an alternative rock band from Dublin, Ireland. After forming in 1996, they signed to Lakota Records in 1999, releasing two hit albums before splitting in 2006. \n\nHistory:\n\nFormation and early years:\nThe band was formed in 1996 by lead singer and songwriter Mark Greaney and drummer Fergal Matthews, while studying at Belvedere College. Greaney grew up in Dublin, where for a time he lived next door to Phil Lynott. Matthews originated from County Meath. The name 'JJ72' derives from a window at Belvedere College made from 72 jam jars. They cited Nirvana, Mudhoney and Joy Division as influences. After auditioning several bassists they recruited their schoolmate Garvin Smith on bass in 1996. After a few early gigs, Smith left, and Greaney and Matthews once again set about auditions for a new bassist. Two bassists had short stints with the band, but in 1997 Greaney and Matthews entered the studio as a duo to record their first demo. They sent it to local record companies and media but with little response. In 1998 they started university courses, but shortly after starting they decided to concentrate on the band; They played a concert at Behan's pub in Dublin, backed by a string quartet, and were asked to appear on local television. They then recruited Hilary Woods, who Greaney had known for several years. Despite having only picked up bass recently, Woods became a member in January 1999. They recorded a second demo, and targeted the UK, playing several gigs there and getting a write-up in Select. This led to interest from the Dublin-based Sony sub-label Lakota Records, who signed the band in mid-1999. \n\nCommercial success:\nDbut single \"October Swimmer\" was released in November that year, and was named 'Single of the Week' by BBC Radio 1 DJ Mark Radcliffe. They were given support slots with The Dandy Warhols and My Vitriol. The band had their first hit with \"Long Way South\" in May 2000, which peaked at number 68 in the UK, and they played at festivals including Glastonbury, Reading and Leeds later that year. \nThe band released their eponymously titled debut album in Summer 2000. A great critical and commercial success alike, the album has sold in excess of 500,000 copies in their native Ireland and in the United Kingdom, where it reached number 16 on the UK Albums Chart. In Germany, a special 'tour edition' was released, including a second CD-ROM disc. The album spawned the singles \"Snow\", \"October Swimmer\", \"Long Way South\", and \"Oxygen\", and saw the band perform promotional tours in Europe and the US. \"Oxygen\" gave the band their first top 30 single in the UK, leading the band to perform on Top of the Pops. After touring with Coldplay and Embrace, they set out on their own headline tour. They supported Muse on a tour of Europe, headlined the NME Brats tour, and played a few gigs in Japan. Several performances had been cancelled after Greaney lost his voice, and there were further cancellations in 2001 after Matthews was knocked off his motorbike, with Kylie Minogue's drummer Bob Knight standing in for a few gigs. Matthews recovered in time for the festival season and support slots with U2. The band received an Irish Music Award for 'Best New Band' later that year. \nThe band's second album I To Sky followed in October 2002. It contained the singles \"Formulae\" and \"Always and Forever\", and reached the Top 5 of the Irish album charts and the Top 20 of the UK Albums Chart. \n\nReturn and split:\nIn March 2003 bassist Hilary Woods left the band. Greaney and Matthews recruited Canadian born bassist Sarah Fox as her replacement. After a two-year silence, the band embarked on their first tour with Sarah Fox in May 2005, and released the download and 7\" only single \"She's Gone\". A second single, \"Coming Home\" followed in August 2005, peaking at number 52 in the UK Singles Chart. A tour followed in September 2005, with Greaney expressing from the stage his frustrations regarding the release of the third album. pending an ongoing dispute with then current record labels Lakota Records/Sony. Songs rumoured to have been included on the new album: \"Take From Me\", \"Radio\",\"Everything\", \"Rainfalls\", \"Underground\", \"Maria\", \"Nothing In This World\", \"Some Day\" (this song, as Demo version, appear as B-side on the \"coming Home\" 7\" vinyl). A promotional CD containing \"Coming Home\", \"Take From Me\", \"Radio\" and \"Everything\" was circulated in 2005. \nHowever, on June 22, 2006, JJ72 issued a press release announcing they were to split up after ten years together. They cited a struggle with their record label as their main reason for the split. This press release read: \n\nPost-JJ72 activities:\nMark Greaney embarked upon his first tour as a solo artist in May 2007. He subsequently formed a new band called Concerto For Constantine, featuring himself (guitar and vocals), Gavin Fox (ex-Idlewild/Turn/Vega4 on bass) and Binzer (ex-BellX1/Frames/Halite on drums). The band performed live throughout Ireland as part of the \"2fm 2moro 2our\" in November 2007, and supported Smashing Pumpkins in Belfast and Dublin in Spring 2008. Concerto for Constantine then went on to sell out headline shows in Dublin and London, and also played at the Oxegen Festival in Ireland and at T In The Park in Scotland in July 2008. Greaney is currently making another record under a new moniker, the title and style of which is as yet unknown. He is also an artist manager, and is a college tutor and Head of Vocals in a Dublin based D.I.T. degree in Modern Music. \nSarah Fox played bass for a band called Lluther, but has since left the band and is now a London based graphic designer. Fergal Matthews lives in Norway and plays drums for Blodhevn. Woods is a visual artist and is involved in her own solo project The River Cry, her debut album is due for release early 2013.  \n\nBand member details:\nMark Greaney (vocals, guitar, piano) born 23 June 1980., \nFergal Matthews (drums) born 29 January 1980, in Dublin., \nHilary Woods (bass, backing vocals) born 30 May 1980., \nSarah Fox (bass) - from 2003 onwards., \nGarvin Smith (bass) - early line-up.",
                "avatar": "https://i.ytimg.com/i/z23JPZV6G9L9cb7uXuXiBQ/mq1.jpg",
                "name": {
                    "first": "JJ72"
                }
            }
