                "hashtag": "#BernardButler",
                "bio": "Bernard Joseph Butler (born 1 May 1970, Stamford Hill, North London) is an English musician and record producer. He is best known as the first guitarist and primary songwriter with Suede, until his departure in 1994. He has been hailed by some critics as the greatest guitarist of his generation, as well as one of Britain's most original and influential guitarists. He was voted the 24th greatest guitarist of the last 30 years in a national 2010 BBC poll and is often seen performing with a 1961 cherry red Gibson ES-355 TD SV (Stereo Varitone) with a Bigsby vibrato tailpiece. \n\nCareer:\n\nSuede:\nHe first achieved fame in 1992 as the guitarist with Suede, forging a songwriting partnership with Brett Anderson. He co-wrote and played guitars on every recording until 1994, when he exited Suede, leaving behind the Mercury Music Prize-winning debut Suede, as well as the follow-up Dog Man Star. \n\nPost-Suede:\nImmediately after leaving Suede he formed the duo McAlmont and Butler with David McAlmont and they released two singles, \"Yes\" and \"You Do\". A compilation album, The Sound of McAlmont and Butler, was released after the collaboration ended. \nButler then released two solo albums under his own name, People Move On and Friends and Lovers, on Creation Records, yielding the hit single \"Stay\". In 2001 Butler teamed up with McAlmont for a second McAlmont and Butler album, Bring it Back, and they toured the UK after the release of two singles, \"Falling\" and \"Bring it Back\". \nIn 2004 Butler formed a new band with Brett Anderson, The Tears, based on the same style that yelded their first successes with Suede in the early 1990s. The Tears released their debut LP, Here Come The Tears, produced by Butler, in June 2005. Singles include \"Refugees\", which reached number 9 in the UK Singles Chart, and \"Lovers\". \n\nCollaborations and production work:\nButler has played on and/or produced records byAimee Mann, Edwyn Collins, Neneh Cherry, Tim Booth (of James), Eddi Reader, Hopper, Roy Orbison, Bert Jansch, The Libertines, Heather Nova, Mark Owen, The Veils, Sophie Ellis-Bextor, The Cribs, the Pretenders, The On-Off's, 1990s, The Mescalitas, Cut Off Your Hands, Cajun Dance Party, The View, Arkitekt, Sons and Daughters, Black Kids, Tricky, Sharleen Spiteri, Nerina Pallot and Natalie McCool. \nIn 2005 he was introduced to Welsh singer Duffy, and contributed to her top-selling debut album Rockferry--it was the best selling album of 2008 in the UK--which won the Best Pop Vocal Album Grammy Award in 2008. Duffy eventually parted ways with her manager and Butler, and Butler told the media in April 2014, in regard to the Welsh singer's musical career difficulties: \n\nShe Duffy went off the rails and it all went pear-shaped for her. And maybe she brought all those problems on herself. But I always had quite a lot of sympathy for her, because she was young, from this tiny village in Wales, and she was just hurled into the fire. \n\nIn 2009 Butler co-wrote/produced/played on tracks by The Veils, Tommy Reilly, Jonathan Jeremiah,Kate Jackson and Catherine A.D. He also commenced production work on Kate Nash's second album My Best Friend Is You in mid-2009. \nIn 2010 Butler worked with Nerina Pallot, Fyfe Dangerfield, Noisettes, Slow Club, Gabrielle, Howling Bells, The Veils, Simon Dine, and new artists Jodie Marie, Vince, Daley, Summer Camp, Joe Worricker and Scott McFarnon. \nOver the 2011-2012 period, Butler produced albums for Frankie & The Heartstrings and continued working with Daley on his forthcoming Days & Nights album, the title track of which was co-written and produced by Butler. He also co-wrote and produced Texas's comeback album The Conversation. Butler again worked at Studio 355 for these recordings. \nIn 2013 Butler worked with the group Teleman, to finish their debut album; worked on songs with London group Flowers; and collaborated with Paloma Faith and Fyfe Dangerfield. In June 2013, he formed an impromptu improvisational performance at the Sunderland record store run by Frankie & The Heartstrings. Alongside members of Warm Digits, Field Music and 1990s, the impromptu group played a completely unrehearsed and improvised set. \nIn August 2013, Butler played two shows at The Slaughtered Lamb in London, UK, accompanying Ben Watt on electric guitar. Watt described the start of their musical relationship in 2014: \n\nWe ran into each other at a party a few years ago and just got chatting. I'd spent ten years in electronic music, running Buzzin' Fly (his underground house and techno record label) and DJ-ing whilst Bernard had spent ten years as a producer and collaborator. We both wanted a change. \n\nIn October 2013, new group Trans released the red EP, the first in a series of EPs for Rough Trade Records. Featuring tracks grown out of improvisational sessions that date back over a year, with Jackie McKeown, Paul Borchers and Igor Volk, the recordings were made at Studio 355. All sessions were improvised, recorded in their entirety and later edited with very few overdubs. To date, Trans have played a select number of shows, including an entirely improvised show at London's Shacklewell Arms venue, acting as carriers for former Can pioneer Damo Suzuki. \nIn February 2014, Butler played two lives shows with Watt at London's St Pancras Old Church, in the lead-up period to the release of Watt's solo album Hendra. Butler was also involved with the recording of the album, with Watt explaining that he knew that Butler would be the \"perfect counterpoint to bring some darkness to the light.\" \nHendra, Watt's first solo album since 1983, was released on 14 April 2014 and Butler joined Watt on an eight-show UK tour in support of the album. including shows at the Nottingham venue \"The Bodega\", Hebden Bridge and Cambridge. Butler than played again with Watt in November 2014 as part of the Ben Watt Trio. \nIn May 2014, Butler organised two special McAlmont & Butler performances to raise funds for The Bobath Centre's work with children with cerebral palsy. The London shows at the Union Chapel and Islington Assembly Hall sold out, and the duo were accompanied by a full band that consisted of members of The Magic Numbers, Mako Sakamoto on drums and Sean Read on keyboards. \n\nSoundtracks:\nButler created the soundtrack to the 1997 film The James Gang and played on the soundtrack of Velvet Goldmine, alongside Thom Yorke and Jonny Greenwood of Radiohead. \n\nInfluences:\nButler names former Smiths guitarist Johnny Marr as his major inspiration. He started learning guitar playing after hearing Marr and was eventually able to play all Smiths songs by ear. \n\nPersonal life:\nOn 13 April 2014, Butler participated in the London Marathon to raise funds for children with cerebral palsy, described by Butler as one of the \"worst starts in life\". Butler explains: \n\nThe problem is it's getting harder for families to get funding for therapy and children aren't getting the specialist support they need. So I'm raising money for the charity's treatment fund to make sure that children get seen as early as possible when it will have the greatest impact. \n\nOn 18 April 2014, 61 donors had pledged 2,136.25 to Butler's campaign. \n\nAwards:\nButler won the Producer's Award at the 2009 BRIT Awards, Producer of the Year at the 2008 Music Managers Forum Awards, and was nominated for Best Producer at the 2009 Music Week Awards.",
                "avatar": "https://i.ytimg.com/i/18xnojq8WolHMWVjJc5vRA/mq1.jpg",
                "name": {
                    "first": "Bernard Butler"
                }
