                "hashtag": "#TheVerve",
                "bio": "The Verve were an English rock band formed in Wigan in 1990 by lead vocalist Richard Ashcroft, guitarist Nick McCabe, bass guitarist Simon Jones and drummer Peter Salisbury. The guitarist and keyboard player Simon Tong became a member at a later date. \nBeginning with a psychedelic sound, by the mid-1990s the band had released several EPs and three albums. It also endured name and line-up changes, break-ups, health problems, drug abuse and various lawsuits. The band's commercial breakthrough was the 1997 album Urban Hymns, one of the best-selling albums in UK Chart history. The album features the hit singles \"Bitter Sweet Symphony\", \"The Drugs Don't Work\" and \"Lucky Man\". In 1998, the band won two Brit Awards--winning Best British Group, appeared on the cover of Rolling Stone magazine in March, and in February 1999, \"Bitter Sweet Symphony\" was nominated for the Grammy Award for Best Rock Song. \nSoon after their commercial peak, The Verve broke up in April 1999, citing internal conflicts. According to Billboard magazine, \"the group's rise was the culmination of a long, arduous journey that began at the dawn of the decade and went on to encompass a major breakup, multiple lawsuits, and an extensive diet of narcotics\". During an eight-year split, Ashcroft dismissed talk of a reunion, saying: \"You're more likely to get all four Beatles on stage.\" The band's original line-up reunited in June 2007, embarking on a tour later that year and releasing the album Forth in August 2008, which spawned the hit single \"Love Is Noise\". Amid revived tensions, the band broke up for the second time in 2009. \n\nHistory:\n\nFormation and Verve (1990-1992):\nThe founding members of The Verve met at Winstanley Sixth Form College, in Wigan, Greater Manchester. The band was initially known as just \"Verve\", and their first gig was at a friend's birthday party (Mark Doherty, from Pennyburn) at the Honeysuckle Pub, in Wigan, on 15 August 1990. Most of the band's early material was created through extensive jam sessions. Fronted by singer Richard Ashcroft, the band caused a buzz in early 1991 for its ability to captivate audiences with its musical textures and avant-garde sensibilities. \nThe group was signed by Hut Records in 1991 and their first studio releases in 1992, \"All in the Mind\", \"She's a Superstar\", and \"Gravity Grave\" (along with the December 1992 EP Verve) saw the band become a critical success, making an impression with freeform guitar work by McCabe and unpredictable vocals by Ashcroft. Those first 3 singles reached the first spot in the UK Indie charts, and \"She's a Superstar\" entered the UK Top 75 Singles Chart. The band saw some support from these early days in the United States in some music scenes in big cities like New York connected with psychedelic music. \n\nA Storm in Heaven (1993-1994):\n1993's A Storm in Heaven was the band's full-length debut, produced by record producer John Leckie (of Simple Minds, Radiohead, The Stone Roses, XTC and The Fall fame). \"Blue\" was released as the lead single and again managed to enter in the UK Top 75 at No. 69 and reached No. 2 in the Indie charts. The album was a critical success, but was only a moderate commercial success, reaching No. 27 in the UK album chart that summer. The second single from the album, \"Slide Away\", topped the UK indie rock charts. During this period the band played a number of gigs with Oasis who, at the time, were relatively unknown. \nIn 1994, the band released the album No Come Down, a compilation of b-sides plus a live version of \"Gravity Grave\" performed at Glastonbury Festival in 1993. It was the band's first release under the name \"The Verve\", following legal difficulties with the jazz label Verve Records. \nThe band then played on the travelling U.S. alternative rock festival, Lollapalooza, in the summer of 1994. A new mix of \"Blue\" was released in the U.S. to promote the band. The tour became notorious for the events of 11 July - Ashcroft was hospitalised for dehydration after a massive session of drinking, and Salisbury was arrested for destroying a hotel room in Kansas in a drug-fuelled delirium. However, the band were performing again the very next day. Ashcroft later recalled: \"At the start, it was an adventure, but America nearly killed us.\" \n\nA Northern Soul and first break-up (1995-1996):\nThe band's physical and mental turmoil continued into the chaotic recording sessions of the band's second album, 1995's A Northern Soul, produced by Owen Morris. The band departed from the experimental psychedelic sounds of A Storm in Heaven and focused more on conventional alternative rock, with Ashcroft's vocals taking a more prominent role in the songs, although reminiscent of some of the early work. Around this period, Oasis guitarist and friend of Ashcroft, Noel Gallagher, dedicated the song \"Cast No Shadow\" on the album (What's the Story) Morning Glory? to Ashcroft, and Ashcroft returned the gesture by dedicating the song \"A Northern Soul\" to Noel. \nThe band released the album's first single \"This Is Music\" in May, and it reached No. 35, their first single to reach the Top 40. It was followed by \"On Your Own\" in June which performed even better, reaching No. 28. This single was particularly new for The Verve as it was a soulful ballad. The album reached the UK Top 20 upon its release in July, but Ashcroft broke up the band three months later, just before the release of the third single \"History\", which reached No. 24 in September. Ashcroft later stated: \"I knew that I had to do it earlier on, but I just wouldn't face it. Once you're not happy in anything, there's no point living in it, is there? But my addiction to playing and writing and being in this band was so great that I wouldn't do anything about it. It felt awful because it could have been the greatest time of our lives, with \"History\" doing well, but I still think I can look myself in the mirror in 30 years time and say, 'Yeah man, you did the right thing.' The others had been through the same thing. It was a mixture of sadness and regret, and relief that we would have some time away.\" \nAshcroft reunited with Jones and Salisbury just a few weeks after the break-up, but McCabe did not rejoin them. The new band hired former Suede guitarist Bernard Butler, but he spent only a couple of days with the band. The band then chose Simon Tong, a school friend credited with originally teaching Ashcroft and Jones to play guitar. The band made no live appearances for all of 1996, apart from a solo performance from Ashcroft supporting Oasis in New York. The rest of the year was spent playing and recording songs for a new album. \n\nCommercial success and second break-up (1997-1999):\nIn early 1997, Ashcroft decided to ask McCabe to return, stating: \"I got to the point where nothing other than The Verve would do for me\". McCabe obliged and with the original line-up back together (Tong remained on guitar alongside McCabe), the group went through a \"spiritual\" recording process to finish their third album Urban Hymns which was completed by early summer. \nFor the first time in their career, The Verve experienced widespread commercial success with their new material. The album's first single \"Bitter Sweet Symphony\" entered the UK charts at number 2 in June 1997, but the song's success was marred by legal problems regarding ownership of the song. Even though the group had secured permission to use a sample of 4 bars of an orchestral rendition of \"The Last Time\" by The Rolling Stones, it was successfully argued that the group had relied too heavily on the song's original vocal melody as well, and they were forced to surrender copyright and royalties to Mick Jagger and Keith Richards. The music video for \"Bitter Sweet Symphony\", which received heavy rotation on MTV, focuses on Ashcroft lip-synching the song while walking down a busy London pavement, oblivious to what is going on around and refusing to change his stride or direction throughout. \nIn August 1997, the band began playing their first gigs in two years, beginning the Urban Hymns Tour. The next single, \"The Drugs Don't Work\" gave the band their first UK number 1 single in September. The album immediately reached number 1 on the charts later that month, knocking off Oasis' highly anticipated album Be Here Now in the process. The band saw an overwhelming increase in popularity overseas, and \"Bitter Sweet Symphony\" reached number 12 on the U.S. charts, the band's highest ever American position. The album reached the US Top 30, going platinum in the process. \nCritic Mike Gee of iZINE said of this time, \"The Verve, as he (Richard Ashcroft) promised, had become the greatest band in the world. ...The Verve were no longer the question mark or the clich. They were the statement and the definition.\" By November the band released \"Lucky Man\" in the UK and reached number 7. At the 1998 Brit Awards in February, The Verve won the awards for Best British Group and Best British Album (Urban Hymns). The band's singles were given extensive airplay on US rock stations and Ashcroft, and band mates, appeared on the cover of Rolling Stone magazine in March 1998. Then, as the band was on a successful tour to promote the album, Jones collapsed on stage. This was the first of many problems to come for the band in the next months. In 1998, McCabe, Tong, Jones and drummer Leon Parr formerly with Mr. So & So and Mosque were commissioned for a soundtrack for a Jonny Lee Miller film which was recorded in Kilburn. These never made it to the final film due to delays on their part. At the 1998 MTV Video Music Awards, \"Bitter Sweet Symphony\" was nominated for Video of the Year, Best Group Video, and Best Alternative Video. \nOn 24 May of that year, the band played a homecoming concert in front of 33,000 fans in the grounds of Haigh Hall & Country Park, Aspull, supported by Beck and John Martyn. The band then played gigs in mainland Europe. However, on 7 June a post-show bust-up at Dsseldorf-Philipshalle left McCabe with a broken hand and Ashcroft with a sore jaw. After this, McCabe decided he could not tolerate the pressures of life on the road any longer and pulled out of the tour, leaving the band's future in jeopardy, with rumours of a split circulating in the press. \nDespite this, the band continued with established session guitarist B. J. Cole replacing McCabe. McCabe's guitar work was heavily sampled and triggered on stage. The band played another American tour, which was riddled with problems as venues were downsized and the support act Massive Attack dropped out. The band then returned to England for two headline performances at the V Festivals, which received poor reviews, with NME stating \"where songs used to spiral upwards and outwards, they now simply fizzle tamely.\" In February 1999, \"Bitter Sweet Symphony\" was nominated for the Grammy Award for Best Rock Song. The Verve played their last gig at Slane Castle in Ireland on 29 August. A long period of inactivity followed. Finally, in April 1999, it was announced that The Verve had split up. \n\nPost-breakup activities (2000-2006):\nBy the time the band had split, Ashcroft had already been working on solo material accompanied by, among others, Salisbury and Cole. In 2000, he released his first solo album, Alone with Everybody, which reached number 1 in the UK album charts. Ashcroft's next album Human Conditions was released to poorer sales in 2002, and Ashcroft was subsequently absent from the music business for several years. During this time Salisbury was the drummer for Black Rebel Motorcycle Club's UK tour in 2004, after their original drummer briefly left due to alcohol and drug abuse. Salisbury also owns a drum shop in Stockport. Ashcroft appeared with Coldplay at Live 8 in 2005, followed by the release of Keys to the World in 2006 and a particularly successful tour that included gigs as the support act for Coldplay's Twisted Logic Tour. \nTong and Jones formed a new group called The Shining, which initially included former Stone Roses guitarist John Squire; however Squire left the band before recording and touring had begun. The band released one album, True Skies, before disbanding in 2003. Jones went on to join the band of Irish artist Cathy Davey. Tong appeared as a live replacement for ex-guitarist Graham Coxon in Blur, and as additional guitarist for Gorillaz (both Jones and Tong played guitar for Demon Days Live). Tong is also a member of an unnamed supergroup formed by Damon Albarn of Blur which released its first album The Good, the Bad & the Queen in January 2007. McCabe worked in different projects like the London-based Neotropic project and played with some established artists, including John Martyn, Leeds-based band The Music, The Beta Band and Faultline. \nThe Verve's members sometimes expressed bitter sentiments about the band's later years. In his only interview after the split, McCabe said of Urban Hymns: \"By the time I got my parts in there it's not really a music fan's record. It just sits nicely next to the Oasis record\", though conceding, \"I'm not going to say it was bad. I mean, we were good as far as pop goes\". During his solo career, Ashcroft expressed regret at having asked McCabe to return for the album instead of releasing it under his own name, saying: \"Imagine being the guy that's written an album on his own, bottles it near the end, feels like there's unfinished business, rings Nick McCabe up who adds some guitars, puts it out as The Verve and the same problems arise again. Imagine being that mug. I've now got to rewrite history. Everyone thinks those songs are somehow associated with another bunch of people that I'm not with now\". Jones claimed that \"The Verve were going off in a direction of strings and ballads, and that's not where I was coming from at all. Loud guitars is it for me\", though noting that this was not why the band split up. \n\nReunion and Forth (2007-2008):\n\nAshcroft had been adamant that The Verve would not reform, once remarking: \"You're more likely to get all four Beatles on stage\". However, after Ashcroft learned that Salisbury was in contact with McCabe over a possible side project, Ashcroft contacted McCabe and Jones, making peace with them, and the band reformed. Tong was not asked to rejoin, so as to keep the internal issues that split the band up a decade ago to an absolute minimum. Jones explained this decision by stating: \"It would have been too hard, it's hard enough for the four of us. If you bring more people to it, it's harder to communicate and communication has always been our difficulty\". On 26 June 2007, the band's reunion was announced by Jo Whiley on BBC Radio 1. The band, reuniting in their original line-up, announced they would tour in November 2007, and release an album in 2008. The band stated: \"We are getting back together for the joy of music\", though they turned down a multi-album deal offer \"because the 'treadmill' of releasing albums and touring marked the beginning of the end for the band a decade ago\". \nTickets for their six-gig tour in early November 2007 sold out in less than 20 minutes. The tour began in Glasgow on 2 November, and included 6 performances at the Carling Academy Glasgow, The Empress Ballroom and the London Roundhouse. Since the 6-gig tour went extremely well in sales, the band booked a second, and bigger tour for December. They played at O2 arena, the SECC in Glasgow, the Odyssey in Belfast, the Nottingham Arena and Manchester Central. Each show from the first and second part of the tour were sold out immediately. The band continued touring in 2008. They played at most of the biggest summer festivals and a few headline shows all over North America, Europe, Japan and the UK between April and August. Including shows at the Coachella Valley Music and Arts Festival, also at the Madison Square Garden Theater, and the Pinkpop festival, Glastonbury Festival, T in the Park, the V Festival, Oxegen Festival, Rock Werchter, Rock am Ring and Rock im Park and The Eden Project Sessions. \n\nThe band's new single, \"Love Is Noise\", was premiered by Zane Lowe on BBC Radio 1 on 23 June. They performed at the coveted Sunday night slot on the Pyramid Stage at Glastonbury on 29 June, closing the show with the new song. The Verve released a free download of a non-album track, \"Mover\", on 30 June. The song had been performed by the band in 1994, but had never seen a proper recording until the reunion. The track was available for download from their official website for one week only. \nThe band announced the new album's title: Forth, which was released in the UK on 25 August and the following day in North America. The album reached No. 1 on the UK Albums Chart on 31 August. The lead single \"Love Is Noise\" was released in the UK on 3 August digitally and one week later (11 August) on its physical form, peaking at No. 4 in the UK. The song was a moderate success in Europe, charting at No. 16 in the European chart (with 6 weeks in the Top 20). \"Rather Be\", the second single from the album, was released in November 2008 but did not become as successful as \"Love Is Noise\" was, peaking at number 56 on the UK Singles Chart. \n\nThe Verve \"on holiday\" (2009-present):\nIn August 2009 The Guardian speculated that The Verve had broken up for a third time, with Jones and McCabe no longer speaking to Ashcroft as they felt he was using the reunion as a vehicle to get his solo career on track. Being asked about the supposed split, Ashcroft told The Daily Telegraph, \"I can confirm we did what we set out to do ... Right now there are no plans to be doing anything in the near future.\" \nMcCabe and Jones have since started their own project, The Black Ships, who later changed their name to Black Submarine, along with electric violinist and arranger Davide Rossi and drummer Mig Schillace. Nick McCabe says \"The Verve seems to be on holiday\" on his MySpace page. \nOn 7 July 2010 Ashcroft confirmed that the band \"is over for good\", though some weeks later did not rule out another Verve reunion. \n\nBand members:\n\nOfficial members:\nRichard Ashcroft - lead and backing vocals, rhythm guitar, keyboards, bass, percussion (1990-1995, 1996-1999, 2007-2009), \nNick McCabe - lead guitar, piano, keyboards, accordion (1990-1995, 1997-1998, 2007-2009), \nSimon Jones - bass, keyboards, backing vocals (1990-1995, 1996-1999, 2007-2009), \nPeter Salisbury - drums, percussion (1990-1995, 1996-1999, 2007-2009), \nSimon Tong - guitar, keyboards (1996-1999), \n\nLive or session members:\nBernard Butler - lead guitar (1996) (Session member, considered for becoming a full-time member before McCabe returned to the band to record Urban Hymns), \nB. J. Cole - pedal steel guitar (1998) (Live member in the final months of 1998 after McCabe's second quit)",
